import React, { Component } from 'react';
import './ManageIPO.css';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import Button from 'react-bootstrap/Button';
import { DropdownButton,Dropdown} from 'react-bootstrap';
import NavWithDropDown from '../NavBar';
import Card from 'react-bootstrap/Card';
import Row from 'react-bootstrap/Row';

export class IPOCard extends Component {

    constructor(props){
        super(props);
    }

    render(){

        return(
                    <Card bg="dark" id="each-card" text="black" style={{ width: '10px' }} className="mb-2">
                        <Card.Header>Sector : {this.props.companyName}</Card.Header>
                        <Card.Body>
                        <Card.Title>{this.props.companyName}</Card.Title>
                        <Card.Text>
                            {this.props.remarks}
                        </Card.Text>
                        <Card.Link href={`/company/${this.props.companyName}`}>Click here to know more</Card.Link>
                        </Card.Body>
                    </Card>  
            
        );
    }
}

class ManageIPO extends Component{
    constructor(props){
        super(props);
        this.state = {
            data : []
        }
        this.displayData = this.displayData.bind(this);
    }

    displayData(){

        var IPOCardList = [];
        var data = this.state.data;
        for(var i = 0; i < data.length; i++) {
            var ipoBanner = <IPOCard key={i}
                                             ipoId={data[i].id}
                                             companyName={data[i].companyName}
                                             companySector={data[i].stockExchange}
                                             companyPPS={data[i].pricePershare}
                                             companyShares={data[i].numberOfShares}
                                             openDate = {data[i].openDate}
                                             remarks = {data[i].remarks}
                                             />
            IPOCardList.push(ipoBanner);
        }
        return IPOCardList;
    }

    componentDidMount(){
        console.log("token" + this.props.getAuthToken());
        var requestOptions = {
            method : 'GET',
            headers : {"Authorization" : "Bearer " + this.props.getAuthToken() }
        }
        fetch("http://localhost:8082/company/ipo/getIPO",requestOptions)
        .then(response =>  response.json())
        .then(data => {
            this.setState({data : data});
        })
    }

    render(){
        return(
            <React.Fragment>
                <NavWithDropDown />
                <br></br>
                <br></br>
                <br></br>
                <Container fluid>
                    <Card id="main-card">
                        <Card.Header id="card-header">Upcoming IPO</Card.Header>
                        <Card.Body id="card-body">
                            <Row md="4">
                                {this.displayData()}
                            </Row>
                            
                        </Card.Body>
                    </Card>
                </Container>
            </React.Fragment>
        );
    }
}

export default ManageIPO;
